import React from "react";
import Card from "./Card.js";

const Cards = (props) => {
  return (
    <div>
      {props.songs.map((song) => {
        <Card
          name={song.name}
          artist={song.artist}
          chords={song.chords}
          youtube={song.youtube}
          status={song.status}
          lyrics={song.lyrics}
        />;
      })}
    </div>
  );
};

export default Cards;
